export const CANVAS_WIDTH = 20;
export const CANVAS_HEIGHT = 10;

export const createCanvas = () => 
    Array.from(Array(CANVAS_WIDTH), () =>
        new Array(CANVAS_HEIGHT).fill([0, 'clear'])
    )
